    if (filters.length > 0) {
      const filterString = encodeURIComponent(JSON.stringify(filters));
      queryString += `&filter=${filterString}`;
    }
    const url = `https://example.com/forms?${queryString}`;
    console.log(url); // You can replace this with actual API call
